            {
              label: 'Clinical Levels',
              items: [],
            },
          ];

          // set filter options for grid
          const clinicalFilterOptions: { value: string; label: string }[] = [];
          const yearFilterOptions: ICalendarFilter[] = [];
          this.maxEndDate = undefined;
