              !clinicalFilterOptions.some(
                (x) =>
                  x.value === item.clinicalLevel?.replaceAll(' ', '_').trim()
              )
            ) {
              clinicalFilterOptions.push({
                value: item.clinicalLevel?.replaceAll(' ', '_').trim(),
                label: item.clinicalLevel,
              });
