                .concat(' - ', itemYear);
            }
            if (!yearFilterOptions.some((x) => x.label === yearFilter)) {
              yearFilterOptions.push({
                label: yearFilter,
                value: {
                  value: yearFilter?.replaceAll(' ', '_').trim(),
                  field: 'year',
                },
              });
