    if ($event.isEdit) {
      this._store
        .dispatch(new UpdatePSAppointmentAndPrivilege(newAppointment))
        .pipe(untilDestroyed(this))
        .subscribe((res) => {
          if (!res.professionalStanding?.appointmentErrors) {
