.action-card {
  background-color: #fff;
  border-radius: 6px;
  box-shadow: 0px 0px 6px #24365526;
  padding: 1.5rem;
  height: 100%;
  min-height: 16rem;
  transition: 150ms ease-in-out;
  position: relative;
  width: 100%;
  .hotspot {
    position: absolute;
    background: none;
    border: none;
    cursor: pointer;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    z-index: 1;
  }
  &:hover {
    box-shadow: none;
  }
  .title {
    font-size: 1.25rem;
    font-weight: bold;
    display: flex;
    align-items: center;
    margin-bottom: 2rem;
    span {
      font-size: 2rem;
      margin-right: 0.75rem;
    }
