import {
  Component,
  CUSTOM_ELEMENTS_SCHEMA,
  EventEmitter,
  Input,
  OnInit,
  Output,
} from '@angular/core';
import {
  FormControl,
  FormGroup,
  FormsModule,
  ReactiveFormsModule,
  Validators,
} from '@angular/forms';
import { CommonModule } from '@angular/common';
import { Observable, Subject } from 'rxjs';
import {
  GetAccreditedProgramInstitutionsList,
  GetStateList,
  IPickListItem,
  PicklistsSelectors,
} from 'src/app/state/picklists';
import { IStateReadOnlyModel } from 'src/app/api';
import { Select, Store } from '@ngxs/store';
import { InputSelectComponent } from '../../../shared/components/base-input/input-select.component';
import { IAccreditedProgramInstitutionReadOnlyModel } from 'src/app/api/models/picklists/accredited-program-institution-read-only.model';
import { AutoCompleteModule } from 'primeng/autocomplete';
import { InputTextModule } from 'primeng/inputtext';
import { DropdownModule } from 'primeng/dropdown';
import { CalendarModule } from 'primeng/calendar';
import { ITrainingTypeReadOnlyModel } from 'src/app/api/models/picklists/training-type-read-only.model';
import { IAdvancedTrainingModel } from 'src/app/api/models/medicaltraining/advanced-training.model';
import { validateStartAndEndDates } from '../../validators/validators';
import { GlobalDialogService } from '../../services/global-dialog.service';

@Component({
  selector: 'abs-training-add-edit-modal',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule,
    InputSelectComponent,
    AutoCompleteModule,
    InputTextModule,
    DropdownModule,
    CalendarModule,
  ],
  templateUrl: './training-add-edit-modal.component.html',
  styleUrls: ['./training-add-edit-modal.component.scss'],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class TrainingAddEditModalComponent implements OnInit {
  @Input() training$: Subject<IAdvancedTrainingModel> = new Subject();
  @Input() isEdit$: Subject<boolean> = new Subject();
  @Input() userId!: number;
  @Output() cancelDialog: EventEmitter<any> = new EventEmitter();
  @Output() saveDialog: EventEmitter<any> = new EventEmitter();

  @Select(PicklistsSelectors.slices.states) states$:
    | Observable<IStateReadOnlyModel[]>
    | undefined;

  @Select(PicklistsSelectors.slices.accreditedInstitutions)
  accreditedInstitutions$:
    | Observable<IAccreditedProgramInstitutionReadOnlyModel[]>
    | undefined;

  @Select(PicklistsSelectors.slices.trainingTypes) trainingTypes$:
    | Observable<ITrainingTypeReadOnlyModel[]>
    | undefined;

  hasUnsavedChanges = false;

  additionalTrainingForm = new FormGroup(
    {
      trainingType: new FormControl(0, Validators.required),
      startDate: new FormControl(new Date(), Validators.required),
      endDate: new FormControl(new Date(), Validators.required),
      institutionName: new FormControl({ itemDescription: '', itemValue: '' }),
      state: new FormControl({ value: '', disabled: true }),
      city: new FormControl({ value: '', disabled: true }),
      other: new FormControl(''),
    },
    {
      validators: [validateStartAndEndDates('startDate', 'endDate')],
    }
  );

  stateOptions: IPickListItem[] = [];
  institutionOptions: IPickListItem[] = [];
  accreditedInstitutions: IAccreditedProgramInstitutionReadOnlyModel[] = [];
  trainingTypes: ITrainingTypeReadOnlyModel[] = [];
  filteredInstitutionOptions: IPickListItem[] = [];
  trainingId!: number | undefined;
  isEdit!: boolean;

  constructor(
    private _store: Store,
    private globalDialogService: GlobalDialogService
  ) {
    this._store.dispatch(new GetStateList('500'));
    this._store.dispatch(new GetAccreditedProgramInstitutionsList());
    this.states$?.subscribe((value) => {
      this.stateOptions = value;
    });
  }

  ngOnInit() {
    this.setPicklistOptions();
    this.isEdit$.subscribe((isEdit) => {
      this.isEdit = isEdit;
    });
    this.additionalTrainingForm.valueChanges.subscribe(() => {
      const isDirty = this.additionalTrainingForm.dirty;
      if (isDirty && !this.hasUnsavedChanges) {
        this.hasUnsavedChanges = true;
      }
    });
    this.subscribeToTraining();
  }

  subscribeToTraining() {
    this.training$.subscribe((formData) => {
      if (Object.keys(formData).length > 0) {
        this.trainingId = formData.id;
        for (const [key, value] of Object.entries(formData)) {
          this.additionalTrainingForm.get(key)?.patchValue(value);
          if (key === 'institutionName') {
            this.institutionOptions.filter((inst) => {
              if (inst.itemDescription === value) {
                this.additionalTrainingForm.get(key)?.patchValue({
                  itemDescription: inst.itemDescription ?? '',
                  itemValue: inst.itemValue ?? '',
                });
              }
            });
          }
          if (key === 'trainingType') {
            this.trainingTypes.filter((training) => {
              if (training.trainingType === value) {
                this.additionalTrainingForm.get(key)?.patchValue(training.id);
              }
            });
          }
          if (key === 'other') {
            if (value.length > 0) {
              this.clearAutoComplete();
            }
          }
        }

        this.additionalTrainingForm
          .get('startDate')
          ?.patchValue(new Date(formData.startDate ?? ''));

        this.additionalTrainingForm
          .get('endDate')
          ?.patchValue(new Date(formData.endDate ?? ''));
      } else {
        this.additionalTrainingForm.reset();
      }
    });
  }

  clearAutoComplete() {
    this.additionalTrainingForm.get('institutionName')?.patchValue(null);
    this.additionalTrainingForm.get('city')?.patchValue('');
    this.additionalTrainingForm.get('state')?.patchValue('');
  }

  get typeOfTraining() {
    return this.additionalTrainingForm.get('typeOfTraining');
  }

  setPicklistOptions() {
    this.accreditedInstitutions$?.subscribe((insitutions) => {
      this.accreditedInstitutions = insitutions;
      insitutions.forEach((insitution) => {
        this.institutionOptions.push({
          itemValue: insitution.programId.toString(),
          itemDescription: insitution.institutionName,
        });
      });
    });

    this.trainingTypes$?.subscribe((training) => {
      this.trainingTypes = training;
    });
  }

  handleDefaultClose(event: any) {
    event.preventDefault();
  }

  onInstitutionSelect(selected: any) {
    this.additionalTrainingForm.get('other')?.patchValue('');
    this.accreditedInstitutions.filter((i) => {
      if (i.programId === +selected.itemValue) {
        this.additionalTrainingForm.patchValue({
          state: i.state,
          city: i.city,
        });
      }
    });
  }

  filterItems($event: any) {
    const value = $event.query;
    this.filteredInstitutionOptions = this.institutionOptions.filter((i) => {
      return i.itemDescription?.toLowerCase().includes(value.toLowerCase());
    });
  }

  cancel() {
    if (this.hasUnsavedChanges) {
      this.globalDialogService
        .showConfirmation('Unsaved Changes', 'Do you want to navigate away')
        .then((result) => {
          if (result) {
            this.cancelDialog.emit({ show: false });
          }
        });
    } else {
      this.cancelDialog.emit({ show: false });
    }
  }

  save() {
    this.hasUnsavedChanges = false;
    this.saveDialog.emit({
      edit: this.isEdit,
      show: false,
      trainingRecord: this.additionalTrainingForm.value,
      trainingId: this.trainingId,
    });
  }

  trackByFn(
    index: number,
    item: IPickListItem
  ): string | number | null | undefined {
    return item.itemValue;
  }
}

import {
  CUSTOM_ELEMENTS_SCHEMA,
  Component,
  EventEmitter,
  OnDestroy,
  OnInit,
  Output,
} from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { GridComponent } from '../../shared/components/grid/grid.component';
import { TrainingAddEditModalComponent } from '../../shared/components/training-add-edit-modal/training-add-edit-modal.component';
import { FileUploadButtonComponent } from 'src/app/shared/components/file-upload-button/file-upload-button.component';
import { ModalComponent } from 'src/app/shared/components/modal/modal.component';
import { MEDICAL_TRAINING_COLS } from '../../shared/gridDefinitions/medical-training-cols';
import { BASIC_DOCUMENT_COLS } from '../../shared/gridDefinitions/basic-document-cols';
import { BehaviorSubject, Observable, Subscription } from 'rxjs';
import {
  UserProfileSelectors,
  GQAdditionalTrainingSelectors,
  GetAdditionalTrainingList,
  GetAdditionalTrainingDetails,
  UpdateAdditionalTraining,
  CreateAdditionalTraining,
} from '../../state';
import { Select, Store } from '@ngxs/store';
import {
  IAdditionalTrainingModel,
  IAdditionalTrainingReadOnlyModel,
} from 'src/app/api';
import { IAdvancedTrainingModel } from 'src/app/api/models/medicaltraining/advanced-training.model';

import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { DropdownModule } from 'primeng/dropdown';
import { CheckboxModule } from 'primeng/checkbox';
import { RadioButtonModule } from 'primeng/radiobutton';
import { ButtonModule } from 'primeng/button';

interface MedicalTrainingData {
  medicalSchool: any;
  residency: any;
  additionalDocuments: any;
}

@Component({
  selector: 'abs-training-modal',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    GridComponent,
    TrainingAddEditModalComponent,
    FileUploadButtonComponent,
    ModalComponent,
    InputTextModule,
    InputTextareaModule,
    DropdownModule,
    CheckboxModule,
    RadioButtonModule,
    ButtonModule,
  ],
  templateUrl: './training-modal.component.html',
  styleUrls: ['./training-modal.component.scss'],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class TrainingModalComponent implements OnInit, OnDestroy {
  @Output() closeDialog: EventEmitter<any> = new EventEmitter();
  @Select(UserProfileSelectors.userId) userId$: Observable<number> | undefined;

  @Select(GQAdditionalTrainingSelectors.additionalTrainingList)
  additionalTrainingList$:
    | Observable<IAdditionalTrainingReadOnlyModel[]>
    | undefined;

  @Select(GQAdditionalTrainingSelectors.selectedAdditionalTrainingDetails)
  selectedTraining$: Observable<IAdditionalTrainingModel> | undefined;

  fakeOptions = [
    { itemDescription: 'Option 1', itemValue: 'option-1' },
    { itemDescription: 'Option 2', itemValue: 'option-2' },
    { itemDescription: 'Option 3', itemValue: 'option-3' },
    { itemDescription: 'Option 4', itemValue: 'option-4' },
    { itemDescription: 'Option 5', itemValue: 'option-5' },
    { itemDescription: 'Option 6', itemValue: 'option-6' },
    { itemDescription: 'Option 7', itemValue: 'option-7' },
    { itemDescription: 'Option 8', itemValue: 'option-8' },
    { itemDescription: 'Option 9', itemValue: 'option-9' },
    { itemDescription: 'Option 101', itemValue: 'option-101' },
  ];

  userSubscription: Subscription | undefined;
  selectedTrainingSubscription: Subscription | undefined;

  trainingCols = MEDICAL_TRAINING_COLS;
  documentCols = BASIC_DOCUMENT_COLS;
  showTrainingAddEdit = false;
  trainingAddEditTitle: string | undefined;
  emptyTraining: IAdvancedTrainingModel = {
    id: 0,
    userId: 0,
    trainingTypeId: 0,
    trainingType: '',
    programId: 0,
    institutionName: '',
    city: '',
    state: '',
    other: '',
    startDate: '',
    endDate: '',
    createdByUserId: 0,
    createdAtUtc: '',
    lastUpdatedAtUtc: '',
    lastUpdatedByUserId: 0,
  };
  tempTraining$: BehaviorSubject<IAdvancedTrainingModel> = new BehaviorSubject(
    this.emptyTraining
  );
  panels = [
    'medicalSchool',
    'residency',
    'additionalTraining',
    'additionalDocuments',
  ];
  activePanel = 0;

  medicalTraining: MedicalTrainingData = {
    medicalSchool: {},
    residency: {},
    additionalDocuments: {},
  };
  userId: number | undefined;

  constructor(private _store: Store) {
    this.initTrainingData();
  }
  ngOnDestroy(): void {
    this.userSubscription?.unsubscribe();
    this.selectedTrainingSubscription?.unsubscribe();
  }

  ngOnInit() {
    this.getMedicalTraining();
  }

  initTrainingData() {
    this._store.dispatch(new GetAdditionalTrainingList());

    this.selectedTrainingSubscription = this.selectedTraining$?.subscribe(
      (selectedTraining) => {
        if (selectedTraining?.trainingId > -1) {
          this.tempTraining$.next(selectedTraining);
        }
      }
    );
  }

  getMedicalTraining() {
    this.medicalTraining.medicalSchool = {
      statement: 'USA',
      name: 'Johns Hopkins University',
      city: 'Baltimore',
      state: 'MD',
      country: 'USA',
      degree: 'MD',
      yearGraduated: '2010',
    };
    this.medicalTraining.residency = {
      programName: 'General Surgery',
      yearOfCompletion: '2015',
      programNotListed: 'an explanation goes here',
      completedInCanada: null,
      postResidencyPlans: null,
      postFellowshipPlans: null,
      vascularTraining: null,
      vascularFellowship: null,
      thoracicTraining: null,
      thoracicFellowship: null,
    };
    this.medicalTraining.additionalDocuments = {
      multiplePrograms: null,
      completionDocuments: [
        {
          file: new Blob(['Hello, world!'], { type: 'text/plain' }),
          fileName: 'this_is_a_file_name.txt',
          fileType: 'lines',
          uploadDate: new Date('7/01/2022'),
        },
      ],
      recievedABSApprovalLetter: null,
      approvalLetters: [
        {
          file: new Blob(['Hello, world!'], { type: 'text/plain' }),
          fileName: 'this_is_a_file_name.txt',
          fileType: 'lines',
          uploadDate: new Date('7/01/2022'),
        },
      ],
    };
  }

  handleDefaultShowTab(event: any) {
    this.activePanel = this.panels.indexOf(event.detail.name);
  }

  showTabPanel(panel: string) {
    const tabGroup: any | null = document.querySelector('#trainingTabs');
    tabGroup?.show(panel);
  }

  save() {
    if (this.activePanel === this.panels.length - 1) {
      this.close();
    } else {
      this.showTabPanel(this.panels[this.activePanel + 1]);
    }
  }

  close() {
    this.closeDialog.emit();
    // timeout is needed to allow the modal to close before the tab panel is reset
    setTimeout(() => {
      this.showTabPanel(this.panels[0]);
    }, 500);
  }

  uploadFile(event: any, fileList: any[]) {
    if (event.file) {
      fileList.push(event.file);
    }
  }

  showTrainingModal(trainingId?: number | undefined) {
    if (trainingId) {
      this._store.dispatch(new GetAdditionalTrainingDetails(trainingId));
      const selectedTraining = this._store.selectSnapshot<any>(
        GQAdditionalTrainingSelectors.selectedAdditionalTrainingDetails
      );

      this.trainingAddEditTitle = 'Edit Additional / Advanced Training';
    } else {
      this.tempTraining$.next(this.emptyTraining);
      this.trainingAddEditTitle = 'Add Additional / Advanced Training';
    }
    this.showTrainingAddEdit = true;
  }
  saveTraining($event: any) {
    $event.trainingRecord.institutionId = parseInt(
      $event.trainingRecord.institutionId
    );
    if ($event.trainingRecord.dateEnded) {
      $event.trainingRecord.dateEnded = new Date(
        $event.trainingRecord.dateEnded
      );
    }
    if ($event.trainingRecord.dateStarted) {
      $event.trainingRecord.dateStarted = new Date(
        $event.trainingRecord.dateStarted
      );
    }
    console.log('save training', $event);
    // TODO: [Joe] show the universal success/error message
    if ($event.trainingRecord.trainingId > -1) {
      this._store.dispatch(new UpdateAdditionalTraining($event.trainingRecord));
    } else {
      this._store.dispatch(new CreateAdditionalTraining($event.trainingRecord));
    }
    this.showTrainingAddEdit = $event.show;
    this.tempTraining$.next(this.emptyTraining);
  }
  cancelAddEditTraining($event: any) {
    this.showTrainingAddEdit = $event.show;
    this.tempTraining$.next(this.emptyTraining);
  }

  handleGridAction($event: any, fileList?: any[] | undefined) {
    if ($event.fieldKey === 'edit') {
      this.showTrainingModal($event.data.trainingId);
    } else if ($event.fieldKey === 'delete') {
      // TODO: [Joe] once we have the ngx-store implemented see if this can be done cleaner without passing in the fileList
      if (fileList) {
        const index = fileList.indexOf($event.data);
        if (index > -1) {
          fileList.splice(index, 1);
        }
      } else {
        console.log('handle delete', $event);
      }
    } else if ($event.fieldKey === 'download') {
      const link = document.createElement('a');
      link.setAttribute('href', URL.createObjectURL($event.data.file));
      link.setAttribute('download', $event.data.fileName);
      link.style.display = 'none';
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
    } else {
      console.log('unhandled action', $event);
    }
  }
}

